export default function ShowItems() {


    const items = useSelector((newState) => {
        return newState.items
    })


    return (
        <>
            <div className="flex justify-center space-x-6">
                <div>
                    <label>Show All </label>
                    <input type="checkbox" />
                </div>

                <div>
                    <label>Show Undone </label>
                    <input type="checkbox" />
                </div>
            </div>
        </>
    );

}
